function getItemValue(codeId){
	var itemValue = null;
    for(var i=0;i<8982;i++){
        if(codeData[i].codeId == codeId){
            itemValue = codeData[i].codeDesc;
        }
	}
	return itemValue==null?"":itemValue;
}

function writeItemValue(codeId){
	return getItemValue(codeId);
}


function writeItemValues(codeId){
	var itemValue = null;
	if(codeId)
	{
		arr = codeId.split(",");
		for(var i=0;i<arr.length;i++)
		{
			if(itemValue)
			{
				itemValue += "," + getItemValue(arr[i]);
			}
			else
			{
				itemValue = getItemValue(arr[i]);
			}
		}
	}
	return itemValue==null?"":itemValue;
}



